			<div>
				<h3>{props.name}</h3>
				<div className={classes.description}>{props.description}</div>
				<div className={classes.price}>{`$${props.price}`}</div>
			</div>
			<div>
				<form>
					<label>Amount</label>
					<input type="number"></input>
				</form>

				<button>add</button>
			</div>
		</li>
	);
};

export default MealItem;
